window.bookSummaryJSON = "<p>Nothing like setting off catastrophic events to mix things up, on a salvage for a child like no other.</p> <p>\"My name is Rylee, and I am a Tracker.\"</p> <p>When children go missing, and the Humans have no leads, I'm the one they call. I am their last hope in bringing home the lost ones. I salvage what they cannot.</p> <p>Crossing into Ogre country is dangerous when you're a polite, respectful gal. Which means we all know I'm in for a wild ride, despite the new backup I've brought along.</p> <p>Even when things start to go sideways, and enemies close on us from every side, I still believe we have the upper hand.</p> <p>How very blind can one person be when it comes to a salvage for a missing child?</p> <p>I'm about to find out.</p> <p>Performed by Nora Achrati, Chris Genebach, David Jourdan, Bradley Foster Smith, Ken Jackson, Shanta Parasuraman, Yasmin Tuazon, Rob McFadyen, Jacob Yeh, Michael John Casey, Richard Rohan, John Kielty, Christopher Williams, Kimberly Gilbert, Colleen Delany, Amanda Forstrom, Terence Aselford, Eric Messner, Nanette Savard, Alejandro Ruiz, Michael Glenn, Tia Shearer, Natalie Van Sistine, Holly Vagley, James Konicek, Scott McCormick, Lydia Kraniotis, Jessica Lauren Ball, and Rana Kay.</p>"; 
